Alterations to the Granted Application (WEB1151/10) Decision Order P2336) for the refurbishment and extension of existing 2-storey semi-detached property at 20. St Kevin's Park, Dartry, Dublin 6 to include
a) Demolition in part of existing single storey extension to side
and rear;
b) Removal of existing flat roof to single storey extensions to side and rear;
c) Provision of extension at first floor level to side and rear; 
d) Provision of new roof with
associated roof lights to existing single storey extension at rear; 
f) Landscaping to front andrear and all associated site works

Refurbishment and extension of the existing 2 storey semi-detached dwelling.  The development is to include 
(a) Demolition of existing single storey garage, chimney stack and first floor structure to side of property; 
(b) Internal alterations to existing layout at ground, first floor and attic levels;
(c) Provision of a new two storey extension to side of property; 
(d) Provision of a single storey entrance porch element to front of property; 
(e) Construction of a single storey extension to the rear of property comprising dining and living spaces; 
(f) Provision of a dormer window to rear of property;
(g) Modification of existing window layout to rear of property at ground and first floor level; 
(h) Associated landscaping to rear of property including new boundary walls.

PROTECTED STRUCTURE:  The development consist of ;
(a) demolition of associated out-building and store to rear of property;
(b) internal alterations to existing zlayout at lower ground floor level; 
(c) enlargement of existing openings to rear elevation at lower ground floor level;
(d) provision of a new single storey extension at lower ground floor level to the rear of the property comprising of new kitchen and living area;
(e) the conservation and repairof existing historical features; 
(f) all associated site development and landscaping works.

PROTECTED STRUCTURE-Planning permission for development to include development in the curtilage of St. Finian's Church (a protected structure). The development will consist of: 
(1) the demolition of part of an existing boundary wall between the church and the adjacent dwelling, the demolition of the sacristy to the church and the demolition of the existing extensions to the rear of the dwelling;
(2) the construction of a new single storey building of 224.6sqm consisting of a new foyer area between the church and adjacent dwelling, 1 large & 1 small meeting room, store rooms, toilets and plant room;
(3) adjustments to the dwelling currently used for church related functions at ground floor to facilitate the property to be used predominantly as a private dwelling;
(4) the addition of a new living/dining room of 11sqm to the dwelling at first floor level with associated roof terrace;
(5) and the erection of a 2 storey (5.5m) high bell structure adjacent to the new entrance. 
The development will entail minor works to the church where the new building abuts the wall, including the modification of an existing pair of window openings to create a new entrance to the church; no development is proposed to the interior of the church.

For the following :
a) Change of use of the basement from office to night club and part of the car park (part-covered, part open air) from parking to night club; 
b) Construction of external screen walls and suspended floors at basement level;
c) A wheelchair lift from street to basement level, with gate in railings and
b) a 60cm x 60cm wall-mounted sign.

The development will consist of alterations and extension to the rear of the dwelling, comprising: 
- an additional floor, containing a new bedroom, built over the first floor of the existing return;
- a new flat roofed connection between the extended return and the main roof, above the extended stairway;
- demolition of the roof of the existing return;
- demolition of most of the rear slope of the main roof; provision of a box dormer above the first floor window;
- new high level opaque window on the north side of the existing return at first floor level;
All new roofs and external walls to be clad in zinc.

The development will consist of alterations and extension to the rear of the dwelling, comprising: 
- an additional floor, containing a new bedroom, built over the first floor of the existing return;
- a new flat roofed connection between the extended return and the main roof, above the extended stairway;
- demolition of the roof of the existing return;
- demolition of most of the rear slope of the main roof; provision of a box dormer above the first floor window;
- new high level opaque window on the north side of the existing return at first floor level;
All new roofs and external walls to be clad in zinc.

Permission sought for development consisting of:
(a) Part demolition of existing pre-school room (floor area 20.5sqm) to the south of the existing school building;
(b) Construction of single storey flat-roofed classroom extension to the south of the existing school building, with floor area of 81sqm inclusive of 2no. toilets and linking to existing corridor;
(c) Construction of single storey flat-roofed pre-school room extension to the east of the existing school building with floor area of 25sqm, linking to existing corridor;
(d) Associated ancillary site services, development and external works; all on site of existing National School of 0.2846 hectares.

PROTECTED STRUCTURE - Permission for development at this site measuring c.0.71 hectares at the former Mount Argus Monastery. The site is located within the curtilage of Mount Argus Church (Protected Structure Ref. No. 4262). The site is bounded generally by Mount Argus Church to the east, existing new monastery building (reg. ref. 3427/06) to the south, and existing residential development at Mount Argus Avenue to the west, Mount Argus Crescent and Mount Argus Green to the north, and Church Park Avenue to the north east. The proposed development generally comprises the change of use, alterations and extension of an existing former monastery and detached outbuilding (c.4,085sqm gfa), to develop a nursing home facility comprising 92no. en-suite bedrooms and ancillary administration and support facilities (c.6,658sqm gfa). The proposed development generally entails:
(a) the preservation, restoration and minor alterations and refurbishment of all facades, the roof, windows, chimneys and existing bell tower;
(b) the removal of the pitched roof on the 1930's north wing and construction of an extension at second floor level (c.422sqm gfa) over the existing;
(c) the construction of a new 3-storey over basement extension on the northern side of the 1930's north wing, with the basement floor extending in part, under the existing north wing, together with a 3-storey, glazed extension comprising ancillary dining and day room facilities, located within the landscaped courtyard on the southern side of the north wing (c.2,291sqm gfa);
(d) modifications and alterations to the internal building layout including new raised floor levels with associated alterations to existing door openings;
(e) partial demolition (c.98sqm) and the preservation and restoration of the remaining detached outbuilding (c.76sqm) located to the northwest of the former monastery building;
(f) demolition of existing boiler house (c.30sqm) and lift shaft (c.12sqm) in the southwest corner of the courtyard. 
All works to conservation architect's details. Total gross floor area of new and existing buildings is c.6,658sqm. All ancillary and associated site development works to include: a new vehicular and pedestrian entrance from Mount Argus Avenue; 42no. surface car parking spaces; 30no. bicycle spaces; bin storage and service area; landscaping and associated site works and boundary treatments.

The development will comprise the construction of 
(a) 1 no. 2 storey, 3-bedroom detached house;
(b) 1 no. 2 storey over basement, 3-bedroom detached house; 
(c) 1 no. 2 storey over basement, 5-bedroom detached house; 
(d) 2 no. 2 storey over basement, 3-bedroom semi- detached houses; the upgrading of the existing vehicle access onto Temple Road to the east of Levmoss, the forming of a new vehicular access onto Temple Road to the west of Levmoss; and all other site development works above and below ground required to facilitate the development including an internal access road layout and landscaping.

The development will consist of:
(1) the removal of the temporary buildings and fence to the southwest of the existing hall and house;
(2) the construction of a new single storey Pastoral Resource Centre building of 785sqm to the southwest of the existing hall and house. The building will consist of a reception area, function room, coffee dock, parish/seminar rooms, offices, toilets, kitchen and storage spaces;
(3) The building also includes the construction of a new prayer room and reflection pool within a dedicated prayer garden;
(4) No works are proposed to be carried out to the existing buildings on the site.

Planning Permission is sought to ;
1.  Demolish existing vehicle repair workshop and open canopy adjacent;
2.  Construct new vehicle repair workshop and open canopy adjacent.  Ridge of new workshop to be 2m higher over existing.

PROTECTED STRUCTURE - (The site is within the curtilage of a protected structure at no. 25 Wellington Place (RPS Ref. No. 8348), in separate ownership.) The development will consist of: 
The change of use of an existing detached coach house to a mews dwelling to include garage with vehicular access from Wellington Lane; 
Alterations to the existing coach house to include repairs to the existing slate roof, provision of 5no. roof lights, re-opening of 2no. blocked-up windows to rear and replacement of doors and windows; 
Construction of a new single storey link (with 2no. roof lights) and a two storey extension (with 3no. rooflights) to rear of the existing coach house; 
Increase in the height of the boundary wall separating no. 25 Wellington Place and No. 25 Wellington Lane from 1.43m to 2.0m; And all associated site works above and below ground.

PROTECTED STRUCTURE - Planning permission for development as follows:
(a) Installation of external lighting to illuminate front facade of 36, 37 & 38 Westland Row;
(b) Provision of glazed display board with internal light mounted in line with front railing adjacent to entrance  to 36 Westland Row.

PROTECTED STRUCTURE - Córas Iompair Éireann intends to apply for a 10 year planning permission for the development of a 3.216 hectare site mainly comprising the existing CIE car park, CIE Group buildings, Rolling stock maintenance shed, and part of existing railway lines / sidings.  The site is bounded by Seville Place and Oriel Hall to the north; Sheriff Street Lower to the south; Oriel Street Upper to the east; and Connolly Station (Protected Structure) to the west, Dublin 1. The development will consist of the redevelopment of the site to provide a total of 81,538sqm of mixed commercial, residential (106 no. units, 3 no. one bed, 81 no. two bed, 22 no. three bed), community and leisure development comprising: 1. The demolition of the Central Train Control, former fastrack, Irish Rail Regional Building Maintenance, CIE Group IT and HR buildings and the Rolling Stock Maintenance shed currently on the site; and part demolition of vaulted warehouse buildings fronting Sheriff Street Lower; 2. The excavation of 1.78 hectares of the site to -4.2 metres OD to from a basement providing 550 no. car parking spaces (including 25no. disabled parking spaces), 260 no. cycle parking spaces, 4 no. coach parking spaces, plant areas, building service areas, storage and refuse storage facilities;
3. The construction of a new street through the site linking the existing vehicle access to the site on Sheriff Street Lower and a signalised junction to be constructed on Seville Place at the junction of Coburg Place; 4. The construction of an access street to Connolly Station from the new street through the site; 5. The construction of thirteen buildings comprising:Block A - A six storey 7360sqm hotel building involving a four storey extension above the vaults of the former station luggage building (protected structure) to provide hotel bar / restaurant (968sqm) and community/cultural uses (572sqm) on street level fronting Sheriff Street Lower; hotel reception, lounge, function areas and terraces at first floor; and 110 no. bedrooms hotel in the floors above; Block B/C - A five storey 5430sqm building involving a four storey extension above the existing vaults (protected structure) fronting Sheriff Street Lower to provide retail (990sqm) and office uses (320sqm) on street level; cafe / restaurant (102sqm) and terrace and office use (1066sqm) on first floor; and 2984sqm of offices on second to fourth floors; Block D - A five storey 7573sqm building with 543sqm retail / restaurant uses at street level and 7030sqm offices above; Block E - A six/seven storey 10913sqm building with retail/restaurant (665sqm) uses at street level and a leisure facility (1535sqm) at street and first floor level; 8735sqm offices above fronting onto the new street through the site; and east facing roof terrace at fifth floor and south facing roof terrace at sixth floor level; Block F/G - A five storey 9642sqm office building above podium level partially over the existing railway lines/sidings comprising two blocks linked at three levels and including landscaped courtyards at podium level; Block H - A seven storey 8104sqm office building fronting onto the new street through the site providing 1139sqm of retail / restaurant space at street level and 6965sqm office space above; Block I - A five/seven storey 13450sqm office building at the junction of Seville Place and the new street through the site and partially over the existing railway lines / sidings, including the formation of a south facing roof terrace at fifth floor level and an east facing roof terrace at sixth floor level; and the formation of a feature opening and windows in the existing boundary wall  (protected structure) facing Seville Place; Block J/K - A four/five storey block providing 522sqm retail/restaurant and 940sqm community/leisure uses at street level and 33 no. two bedroom and 3 no. three bedroom apartments partially constructed over the vaults (protected structure) facing Seville Place including terraces to each apartment facing north west towards the new internal street, facing north east towards Seville Place and into the landscaped internal courtyard and the provision of children's play area on the first floor roof on the Southern elevation; Block L - A four/five/six storey block (recessed sixth level) providing 824sqm retail/restaurant uses at street level and 3 no. one bedroom, 23 no. two bedroom and 11 no. three bedroom apartments on the floors above including terraces to each apartment facing south west towards the new internal street and a roof terrace to each apartment on fifth floor level; and 4 no. two bedroom duplex apartments in two storey buildings in the internal courtyard; Block M - A two/three/five storey block providing 4 no. two bedroom live-work units at street level, 4 no. two bedroom apartments and 3 no. three bedroom apartment on the floors above including a terrace to each apartment on the north east elevation facing Oriel Street Upper and the formation of window openings and entrances in the existing boundary wall on Oriel Street Upper (protected structure); Block N - Six storey block (recessed sixth level) providing 5 no. two bedroom live-work units and 87sqm of retail/restaurant uses at street level and 17 no. two bedroom and 5 no. three bedroom apartments on the floors above including a terrace to each apartment on the southeast elevation facing Oriel Street Upper and on the south elevation facing Block O and the formation of window openings and entrances in the existing boundary wall on Oriel Street Upper (protected structure); Block O - One/two storey extension above existing single storey building to be retained to from a two/three storey building providing 765sqm of retail/restaurant space and 2 no. restaurant terraces one on the northern and one southern elevation at first floor level.
A 505sqm two storey crèche building and open space within the public space formed by Blocks K and L; 6. A 50sqm single storey retail kiosk building in the public square; 7. The enclosure of the rolling stock maintenance facility and railway sidings beneath the proposed podium structure extending c. 7000sqm. 8. The formation of public open spaces to the east of the new street through the site and between Blocks A and B/C and the provision of a pedestrian link between Sheriff Street Lower to the station access road through a courtyard between Block A and Block B/C; and pedestrian links between the development to Oriel Street Upper; and between Oriel Street Upper to Sheriff Street Lower. 9. All other site works above and below ground required to facilitate the proposed development including 3 no. 500kW biomass boilers and 2 no. 450kW gas boilers in the basement, 7 no. electricity substations and hard and soft landscaping.

PROTECTED STRUCTURE - Proposed development will consist of: 
(i) Conversion of existing 2nd floor bedsits and part of existing 1st floor office into two number one-bedroom apartments and one two-bedroom duplex; 
(ii) conversion of part of existing ground floor office into one-bedroom apartment; 
(iii) all associated site works.

Permission is sought for (A) Conversion of existing side garage to new study room and toilet;
(B) Existing flat roof over side garage and kitchen to be replaced with pitched tiled roof including 3 velux windows in the west facing roof slope and 4 velux windows in the east facing roof slope;
(C) New single storey extension to front (with pitched tiled roof) to provide new porch and extended study room;
(D) New front boundary wall and widening of existing vehicular access.

The development will consist of
(a) A new 16.20sqm single-storey extension at the side of the house;
(b) A new 16.50sqm 2-storey extension at the rear of the house;
(c) A new 5.00sqm single-storey bay window at the front of the house;
(d) New roof-mounted solar panels to the front, side, and rear slopes of the main roof;
(e) New windows to the front, side and rear of the house;
(f) 3m wide inward-opening vehicular gates to the front garden and paving of the front garden for 2no. off street car parking spaces.

Planning permission to develop the site to the side and rear of Chanel College and fronting onto Main Street, Coolock Village. Permission sought for erection of two Electronic Scoreboards and associated advertising:
(i) Scoreboard 1 will be located at the North-Westerly corner of all-weather training pitch and will have an overall dimension of 3.6m wide by 2.2m high, and will be erected to a maximum height of 3.4m above pitch ground level;
(ii) Scoreboard 2 will be located at the South-Westerly corner of the main grass pitch and will have an overall dimension of 5.55m wide by 2.9m high, and will be erected a maximum height of 5.5m above pitch ground level. These works are pursuant to previously approved Planning Permissions under Reg. Ref. 3563/09 and PL29N.235606 (Parent Planning Permission) and Reg. Ref. 3842/10 and Reg. Ref. 4149/10 (Later amendments to planning permission).

PROTECTED STRUCTURE - Amendment to previously permitted office development, Block A (Protected Structure) and new blocks B and C with a gross floor area of 4570sqm at 575, North Circular Road, under planning permission reg ref 4319/09 (as amended by reg ref 2969/10 and 2656/11). 
The site is bounded by St Margaret's Avenue North and Richmond Lane, Dublin 1 with a site area of 0.2185 hectares.  The proposed amendments relate to phase 1 works which include works to Blocks A and B (totalling gross floor area of 3552sqm), excluding Block B second storey (278sqm) and including minor internal modifications comprising of; 
Block A Internal modifications - interchange of the cold water storage tanks and store on lower ground floor, rearrangement of open and cellular office spaces on ground, first and second floors, location of reception on ground floor and omission of platform lift at second floor; 
Block B internal modifications - omission of 1no. feature stair in main circulation area; 
Block B External modifications - omission of glass boxes on east elevation to courtyard and alteration to hard and soft courtyard landscaping. 
There are no amendments to proposed to the permitted phase 1, 19 no. car parking spaces and 40 no. cycle parking spaces together with an ESB substation, plant area, waste storage and other ancillary uses, including a vehicular entrance which will be from  St Margaret's Avenue North.
PHASE 2 works will consist of the remainder of all works as previously granted which mainly comprise Block B second floor level (gross floor area of 278sqm) and Block C (gross floor area 1090sqm), with works to include remaining 8 no. car parking spaces and 20 no cycle parking spaces together with ancillary facilities. A 10 year permission is sought.

Planning permission for development of a new car park at this 0.38 hectare (0.94acre) site, bounded by the Ratoath Road, to the northeast. The site is currently occupied by a temporary single storey school building currently occupied by Colaiste Mhuire, permission for the demolition of which has been granted under register reference 4146/10. The proposed car park is to replace that granted planning permission under register reference 2371/10 the site of which is adjacent to the current planning application site. 
The proposed development consists of the following: (i) 142no. car parking spaces, including 9no. disabled car parking spaces and 21no. bicycle racks, to provide for 42no. bicycles;
(ii) All hard and soft landscape, drainage, external lighting and associated site development works.

For construction of the following: 
(a) two storey office extension to the rear of existing office with a single storey element adjoining the northwest boundary;
(b) 2 no. roof windows to front of the existing roof; 
(c) 1 no. roof window to rear of existing roof; 
(d) 2.6sqm of additional office space at second floor level including zinc roofed flat dormer window to rear; 
(e) modification of existing first floor rear window to provide zinc roofed flat dormer window; 
(f) modifications of existing  lower ground floor windows to the rear to accommodate new office extension and 
(g) associated site works.

PROTECTED STRUCTURE: The development will consist of 
A) Partial demolition of existing two storey structure to rear; 
B) Construction of new single and two storey extensions to the rear;
C) Alterations to the existing property;
D) new vehicular entrance, gates & dishing of the public path to Parnell road 
E) landscaping to front and rear, associated boundary, site, and drainage works.

RETENTION - The development consists of the retention of modifications to the Mental Health and Nursing Home facility previously permitted under 4827/08. The amendments consist of the following:
(i) an increase in the ridge height of the Mental Health building from 10.29 metres to 11.73 metres and associated changes in the roof and elevation profile;
(ii) an increase in the ridge height of the Nursing Home building from 10.3 metres to 11.82 metres and associated changes in the roof and elevation profile;
(iii) the provision of 202.3sqm gross of medical storage floorspace in the roof space of the Mental Health building;
(iv) the provision of 196sqm gross of floorspace in the roof space of the Nursing Home at second floor level for activity room use;
(v) amendment to the north, south, east and west elevations of the Mental Health facility comprising the replacement of permitted stone / timber cladding with render finish;
(vi) amendment to the north and east elevations of the Nursing Home building comprising the replacement of permitted stone / timber cladding with render finish;
(vii) amendment to west elevation of Mental Health facility resulting from re-design of 3no. rooms to west elevation. This development results in an increase in the gross floor area of the development approved under Reg. Ref. 4827/08 from 21,019.45sqm to 21,417.75sqm.

Permission to
1) demolish existing annexe to rear of existing dwelling house;
2) construct new extension (part two storey) to the rear of existing dwelling house;
3) convert existing attic to bedroom including en-suite with two no. dormer windows to rear;
4) provision of three no. additional new windows in gable wall with opaque glazing (two no. on the ground floor & one no. on the first floor);
5) change of existing roof from hipped to gable type;
6) provision of vehicular access to front garden;
7) demolish and remove existing timber storage shed and construct a new replacement shed/store to the rear of existing dwelling.

PROTECTED STRUCTURE - The development will consist of the following works to this protected structure to include:
(a) widening of existing pedestrian entrance gate to front of site onto Palmerston Road to allow for a new vehicular access and construction of new inward opening gates;
(b) all associated site and landscape works including dishing of pavement to Palmerston Road.
